import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import "./Styles/Style.css";
import LandingPage from "./Components/LandingPage";
import Header from "./Components/Navbar";
import AboutPage from "./Components/AboutPage";
import Footer from "./Components/Footer";

function App() {

  return (
    <div className="App">
      <Router>

         <Header />

          <Routes>

            <Route path="/" exact element={<LandingPage />}></Route>
            <Route path="/about" element={<AboutPage />}></Route>

          </Routes>
      </Router>
              <ul id="nav2">
          <button id="menu-btn" class="sticky-top" type="button" data-bs-toggle="offcanvas" data-bs-target="#offcanvasTop" aria-controls="offcanvasTop">Menu</button>

          <div class="offcanvas offcanvas-top" tabindex="-1" id="offcanvasTop" aria-labelledby="offcanvasTopLabel">
            <div class="offcanvas-header">
              <h5 id="offcanvasTopLabel">MENU</h5>
              <button id="close-project" type="button" class="btn-close text-reset" data-bs-dismiss="offcanvas" aria-label="Close"></button>
            </div>
            <div class="offcanvas-body">
              <li class="mx-2"><a href="#">Home</a></li>
              <li><a href="#about">About</a></li>
              <li class="mx-2"><a id="btn-toggle" class="btn" type="button" data-bs-toggle="offcanvas" data-bs-target="#offcanvasBottom" aria-controls="offcanvasBottom">Projects</a></li>
            </div>
          </div>
        </ul>
      <Footer />
    </div>
  );
}

export default App;
